import React, { useState } from 'react';

function App() {
  const [activeTab, setActiveTab] = useState('목표 설정');

  return (
    <div className="min-h-screen bg-gray-100 p-4">
      <div className="max-w-md mx-auto bg-white rounded-lg shadow-lg p-6">
        <h1 className="text-2xl font-bold text-center mb-4">카카오뱅크 홈 챌린지</h1>
        <p className="text-center text-gray-600">현재 탭: {activeTab}</p>
        <button 
          onClick={() => setActiveTab('테스트')}
          className="w-full mt-4 bg-yellow-400 text-black py-2 px-4 rounded-lg font-semibold"
        >
          탭 변경 테스트
        </button>
      </div>
    </div>
  );
}

export default App;
